import React from "react";
import { Food } from "./Food";

export function foodTile(data: Food) {
  return (
    <div className="foodTile">
      <img alt="No img?" src={data.imageUrl} />
      <>
        {data.id + " "}
        {data.ingredients + " "}
        {data.name + " "}
        {data.price}
      </>
    </div>
  );
}
